import React from 'react';
import styled from 'styled-components';
import FeatureInfo from './FeatureInfo'

const StyledSlideFour = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;

  .feature-group {
    width: 100%;
    padding: 30px;
    display: flex;
    flex-direction: row;
    justify-content: flex-start;
    align-items: space-between;
  }
`;

function SlideFour() {
  return (
    <StyledSlideFour className="slide-four">
      <div className='feature-group'>
        <FeatureInfo
          title='SIMPLE MONTHLY PLANNING'
          description='No more restricting leases or loans. Simple month-to-month pricing. No hidden fees!'
        />
        <FeatureInfo
          title='VEHICLE INSURANCE INCLUDED'
          description="That's right, you're protected. All Eleanor plans include full insurance coverage."
        />
        <FeatureInfo
          title='MAINTENANCE IS COVERED'
          description="Leave it to us. Don't worry about maintaining your vehicle. Eleanor covers that as well."
        />
      </div>
    </StyledSlideFour>
  );
}

export default SlideFour;
